import React from "react";
import { isPropertySignature } from "typescript";

function App(props) {
  <div className="top">
  <h2>{props.name}</h2>
  <img
    src={props.img}
    alt="avatar_img"
  />
</div>

  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">

        <div className="bottom">
          <p>{props.tell}</p>
          <p>{props.email}</p>
        </div>
      </div>
    </div>
  );
}

export default App;
